import React, {useEffect} from 'react'


const Fetch = () => {
    const [details, setDetails] = React.useState([])
    useEffect (()=>{

      fetch('https://api.coinlore.net/api/tickers/?start=0&limit')
  .then(response => response.json())
  .then(json => setDetails(json))
    })
  return (



    <div>
      {details.map((detail)=>{
        return(
          <div key={detail.id}>
            <h2> {detail.title} </h2>
          </div>
        )
      })}

    </div>
  )
}

export default Fetch
